import { Container } from '@mui/system';
import React from 'react';
import Navbar from '../components/NavBar';
import Article from '../components/Article';

const MyArticles = () => {
  return (
    <>
      <Navbar />
      <Container maxWidth="md">
        <Box>
          <Article />
        </Box>
      </Container>
    </>
  );
};

export default MyArticles;
